import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  TextField,
  IconButton,
  Box,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Grid,
} from '@mui/material';
import {
  Search as SearchIcon,
  Edit as EditIcon,
  History as HistoryIcon,
} from '@mui/icons-material';
import axios from 'axios';

interface DataDictionaryEntry {
  id: number;
  table_name: string;
  column_name: string;
  data_type: string;
  description: string;
  valid_values: any;
  relationships: any;
  source: string;
  version: string;
  created_at: string;
}

interface HistoryEntry {
  timestamp: string;
  user: string;
  action: string;
  changes: {
    field: string;
    old_value: string;
    new_value: string;
  }[];
}

const DataDictionary: React.FC = () => {
  const [entries, setEntries] = useState<DataDictionaryEntry[]>([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedEntry, setSelectedEntry] = useState<DataDictionaryEntry | null>(
    null
  );
  const [historyDialogOpen, setHistoryDialogOpen] = useState(false);
  const [history, setHistory] = useState<HistoryEntry[]>([]);

  useEffect(() => {
    fetchEntries();
  }, []);

  const fetchEntries = async () => {
    try {
      const response = await axios.get('/api/dictionary/entries');
      setEntries(response.data);
    } catch (error) {
      console.error('Error fetching dictionary entries:', error);
    }
  };

  const handleSearch = (event: React.ChangeEvent<HTMLInputElement>) => {
    setSearchTerm(event.target.value);
  };

  const filteredEntries = entries.filter(
    (entry) =>
      entry.table_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      entry.column_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
      entry.description.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const handleEditClick = (entry: DataDictionaryEntry) => {
    setSelectedEntry(entry);
  };

  const handleHistoryClick = async (entryId: number) => {
    try {
      const response = await axios.get(`/api/dictionary/history/${entryId}`);
      setHistory(response.data);
      setHistoryDialogOpen(true);
    } catch (error) {
      console.error('Error fetching entry history:', error);
    }
  };

  const handleSaveEdit = async () => {
    if (!selectedEntry) return;

    try {
      await axios.put(`/api/dictionary/entries/${selectedEntry.id}`, selectedEntry);
      setSelectedEntry(null);
      fetchEntries();
    } catch (error) {
      console.error('Error updating entry:', error);
    }
  };

  return (
    <Container maxWidth="lg">
      <Typography variant="h4" gutterBottom>
        Data Dictionary
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper sx={{ p: 2, mb: 2 }}>
            <Box sx={{ display: 'flex', alignItems: 'center' }}>
              <TextField
                fullWidth
                variant="outlined"
                placeholder="Search tables, columns, or descriptions..."
                value={searchTerm}
                onChange={handleSearch}
                InputProps={{
                  startAdornment: <SearchIcon sx={{ mr: 1, color: 'gray' }} />,
                }}
              />
            </Box>
          </Paper>
        </Grid>

        <Grid item xs={12}>
          <TableContainer component={Paper}>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Table</TableCell>
                  <TableCell>Column</TableCell>
                  <TableCell>Type</TableCell>
                  <TableCell>Description</TableCell>
                  <TableCell>Source</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {filteredEntries.map((entry) => (
                  <TableRow key={entry.id}>
                    <TableCell>{entry.table_name}</TableCell>
                    <TableCell>{entry.column_name}</TableCell>
                    <TableCell>
                      <Chip label={entry.data_type} size="small" />
                    </TableCell>
                    <TableCell>{entry.description}</TableCell>
                    <TableCell>
                      <Chip label={entry.source} size="small" variant="outlined" />
                    </TableCell>
                    <TableCell>
                      <IconButton
                        size="small"
                        onClick={() => handleEditClick(entry)}
                      >
                        <EditIcon />
                      </IconButton>
                      <IconButton
                        size="small"
                        onClick={() => handleHistoryClick(entry.id)}
                      >
                        <HistoryIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </TableContainer>
        </Grid>
      </Grid>

      {/* Edit Dialog */}
      <Dialog
        open={!!selectedEntry}
        onClose={() => setSelectedEntry(null)}
        maxWidth="md"
        fullWidth
      >
        <DialogTitle>Edit Entry</DialogTitle>
        <DialogContent>
          {selectedEntry && (
            <Grid container spacing={2} sx={{ mt: 1 }}>
              <Grid item xs={6}>
                <TextField
                  fullWidth
                  label="Table Name"
                  value={selectedEntry.table_name}
                  onChange={(e) =>
                    setSelectedEntry({
                      ...selectedEntry,
                      table_name: e.target.value,
                    })
                  }
                />
              </Grid>
              <Grid item xs={6}>
                <TextField
                  fullWidth
                  label="Column Name"
                  value={selectedEntry.column_name}
                  onChange={(e) =>
                    setSelectedEntry({
                      ...selectedEntry,
                      column_name: e.target.value,
                    })
                  }
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  label="Description"
                  multiline
                  rows={4}
                  value={selectedEntry.description}
                  onChange={(e) =>
                    setSelectedEntry({
                      ...selectedEntry,
                      description: e.target.value,
                    })
                  }
                />
              </Grid>
            </Grid>
          )}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setSelectedEntry(null)}>Cancel</Button>
          <Button onClick={handleSaveEdit} variant="contained" color="primary">
            Save
          </Button>
        </DialogActions>
      </Dialog>

      {/* History Dialog */}
      <Dialog
        open={historyDialogOpen}
        onClose={() => setHistoryDialogOpen(false)}
        maxWidth="md"
        fullWidth
      >
        <DialogTitle>Entry History</DialogTitle>
        <DialogContent>
          {history.map((entry, index) => (
            <Paper key={index} sx={{ p: 2, mb: 2 }}>
              <Typography variant="subtitle2">
                {new Date(entry.timestamp).toLocaleString()} by {entry.user}
              </Typography>
              <Typography variant="body2" color="textSecondary">
                {entry.action}
              </Typography>
              {entry.changes.map((change, idx) => (
                <Box key={idx} sx={{ mt: 1 }}>
                  <Typography variant="body2">
                    <strong>{change.field}:</strong> {change.old_value} â†’{' '}
                    {change.new_value}
                  </Typography>
                </Box>
              ))}
            </Paper>
          ))}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setHistoryDialogOpen(false)}>Close</Button>
        </DialogActions>
      </Dialog>
    </Container>
  );
};

export default DataDictionary;
